import React, { Component } from 'react'
import '../js/tabs.js';
export class TabSection extends Component {


    render() {
        return (
            <div>
            <Tabs>
    <TabList>
      <Tab>Title 1</Tab>
      <Tab>Title 2</Tab>
    </TabList>

    <TabPanel>
      <h2>Any content 1</h2>
    </TabPanel>
    <TabPanel>
      <h2>Any content 2</h2>
    </TabPanel>
  </Tabs>
            </div>
        )
    }
}

export default TabSection
